import React, { Component } from 'react';

class PlaylistTable extends Component {
    render() {
        return (
            <div className="list-group col-4 mt-5">
            <a href="#" className="list-group-item list-group-item-action">
                <div className="row">
                    <div className="col-2">
                        <img src="https://kenh14cdn.com/thumb_w/640/2020/8/19/teaser-3-159780809591776695725-crop-159780864873013651439.png" alt="" style={{height:"56px"}}/>
                    </div>
                    <div className="col">
                        <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Eligendi non quis exercitationem culpa nesciunt nihil aut nostrum explicabo reprehenderit optio amet ab temporibus asperiores quasi cupiditate. Voluptatum ducimus voluptates voluptas?</p>
                    </div>
                </div>
            </a>
            <a href="#" className="list-group-item list-group-item-action">Item</a>
            <a href="#" className="list-group-item list-group-item-action">Disabled item</a>
          </div>
        );
    }
}

export default PlaylistTable;
